import React from "react";
import { Route , Routes} from "react-router-dom";
import About from "./About";
import Contact from "./Contact";

const App = () => {
  <>
    <Routes>
      <Route exact  path="/" component={About} />
      <Route path="/Contact" component={Contact} />
    </Routes>

  
  </>;
};

export default App;
